        <p className="">
            "Information is a source of learning. But unless it is organized, processed, and available to the right people in a format for decision making, it is a burden, not a benefit."
        </p>
        <p>
            ~ William Pollard
        </p>
        <div className="flex justify-center text-center items-center space-x-3">
          <Button variant="contained" sx={{backgroundColor: '#b6fff4', color: '#00300'}}>Browse</Button>
          <Button variant="contained" sx={{backgroundColor: '#b6fff4', color: '#00300'}}>MY Libraries</Button>
        </div>
    </div>
  )
}


export default Home;
